INSERT INTO `solutions` (`id`, `name`, `image`, `created_at`, `updated_at`, `banner`, `banner_text`) VALUES
(1, 'Hypermarket Solutions', 'solutions/8g4BUkyyapzQm7ZgeSXo0QLH0Aa6HI0tJT1F6aDm.png', '2025-06-19 19:51:54', '2025-07-09 20:28:56', 'solutions/z1cCXIxvaSnBwjmvg5DKqJhdfAQ4FL2mKNNsbze5.png', 'From procurement to shelf, our Hypermarket Solutions are designed to optimize every layer of your retail operations. We help you automate supply chains, improve inventory accuracy, enhance customer experience, and accelerate time-to-shelf — all tailored to the demands of high-volume retail environments.'),
(2, 'Construction Solutions', 'solutions/B1awxnEIhKDFcho2UwpdBh6Uz1GNIsqsNhz1BawW.png', '2025-07-03 15:23:27', '2025-07-09 20:22:47', 'solutions/mhKpbePjHy551VrS0aJjifh1YBHGXDrBnMfDQiCe.png', 'From blueprint to build, our Construction Solutions are built to drive project success. We help contractors, builders, and developers manage procurement, workforce coordination, site safety, and equipment logistics — enabling faster project delivery, reduced waste, and enhanced site productivity across every stage of construction.'),
(3, 'Hospitality Solutions', 'solutions/Y2sbBx4deyvovzEK8ud0NJBkliM2c472VYpYGsCU.png', '2025-07-03 15:24:26', '2025-07-09 20:23:23', 'solutions/AwQ0L7LZcwFss3K8RWTvbF1aOsieR9SmBGjWkvJU.png', 'From guest experience to backend operations, our Hospitality Solutions are crafted to streamline every aspect of your service delivery. We empower hotels, resorts, and food service providers to enhance customer satisfaction, optimize resource management, and improve operational efficiency — all designed to meet the evolving needs of modern hospitality.');
